import React from 'react';
import { Card, CardContent, Typography, Grid, Avatar } from '@mui/material';

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells = [],
    runes = [],
    participants = [],
    version = "14.21.1",
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const outcomeColor = win ? 'success.main' : 'error.main';

  const team1 = participants.slice(0, 5);
  const team2 = participants.slice(5, 10);

  return (
    <Card variant="outlined" sx={{ bgcolor: '#1e293b', color: '#f0f0f0', mb: 2, p: 2, boxShadow: 3 }}>
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={3}>
            <Avatar
              src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
              alt={champion}
              sx={{ width: 64, height: 64 }}
            />
          </Grid>
          <Grid item xs={9}>
            <Typography variant="h6" color={outcomeColor}>
              {matchOutcome}
            </Typography>
            <Typography variant="body2">
              {kills}/{deaths}/{assists} K/D/A
            </Typography>
            <Typography variant="body2">Duration: {gameDuration}</Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Summoner Spells:</Typography>
            {/* Render spell images */}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Items:</Typography>
            {/* Render item images */}
          </Grid>
          <Grid item xs={12}>
            <Typography variant="subtitle1" color="text.secondary">Runes:</Typography>
            {/* Render runes images */}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Team 1</Typography>
            {/* Render team1 details */}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Team 2</Typography>
            {/* Render team2 details */}
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
}

export default Match;
